import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import CardColumns from 'react-bootstrap/CardColumns';


export default class Portfolio extends Component {
  render() {
    return (
      <div>
        <section className="portfolio-section" data-section="portfolio">
                      <h2 className="main-h2">Projects</h2>
            <div className="row card-wrapper">
              <div className="col-md-12">
                <Card style={{ width: '18rem' }}>
                  <Card.Img variant="top" src="/Users/brandonjernigan/Desktop/Code/my-portfolio/src/img/pexels-greta-hoffman-7674901.jpg" />
                  <Card.Body>
                  <Card.Title>Card Title</Card.Title>
                  <Card.Text>
                    <p>Some quick example text to build on the card title and make up the bulk of
                    the card's content.</p>
                  </Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                  </Card.Body>
                </Card>
              </div>
            </div>
        </section>
      </div>
    )
  }
}
